#!/usr/bin/env node

var cp = require('child_process');

var prefix = '[tilemill configure] ';

function mapnik_config(callback) {
    cp.execFile('mapnik-config', ['--version'], function(err, stdout, stderr) {
        if (err || stderr) {
            return callback(err || new Error(stderr.trim()));
        } else {
            return callback(null,stdout.trim());
        }
    });
}

function protobuf_config(callback) {
    if (process.platform === 'win32') {
        return callback(null,'skipped protobuf check');
    } else {
        cp.execFile('pkg-config', ['protobuf','--version'], function(err, stdout, stderr) {
            if (err || stderr) {
                return callback(err || new Error(stderr.trim()));
            } else {
                return callback(null,stdout.trim());
            }
        });
    }
}

mapnik_config(function(err,result) {
    console.log(prefix + 'Using node v'+ process.versions.node);
    if(err) {
        console.error(prefix + 'Could not configure TileMill because the "mapnik-config" program was not found (' + err.message + ')');
        process.exit(1);
    } else {
        console.log(prefix + 'Successfully found mapnik version v'+result + ' (via mapnik-config)');
        protobuf_config(function(err,result) {
            if (err) {
                console.error(prefix + 'Could not configure TileMill because "pkg-config protobuf --version" returned an error (' + err.message + ')');
            } else {
                console.log(prefix + 'Found libprotobuf v'+result)
                process.exit(0);
            }
        });
    }
});

#!/usr/bin/env node

// increase the libuv threadpool size to 1.5x the number of logical CPUs.
process.env.UV_THREADPOOL_SIZE = Math.ceil(Math.max(4, require('os').cpus().length * 1.5));
process.env.OPENFILEGDB_IN_MEMORY_SPI = "OFF";
var path = require('path');
process.env.MAPNIK_FONT_PATH = path.join(__dirname,'fonts');

var fs = require('fs');
// node v6 -> v8 compatibility
var existsSync = require('fs').existsSync || require('path').existsSync;

process.title = 'tilemill';

// This is necessary to make optimist not special-case into coffeescript as
// certain node installs (e.g. ubuntu node ppa) do not use `node` as the binary
// name.
process.argv[0] = 'node';

if (process.platform === 'win32') {
    // HOME is undefined on windows
    process.env.HOME = process.env.USERPROFILE;
    // Add custom library paths to the PATH
    process.env.PATH = path.join(__dirname,"node_modules/mapnik/lib/binding/");
}

// Default --config flag to user's home .tilemill.json config file.
// @TODO find a more elegant way to set a default for this value
// upstream in bones.
var config = path.join(process.env.HOME, '.tilemill/config.json');
if (existsSync(config)) {
    var argv = require('optimist').argv;
    argv.config = argv.config || config;
}

require('@mapbox/tilelive-mapnik').registerProtocols(require('tilelive'));
require('@mapbox/mbtiles').registerProtocols(require('tilelive'));

require('bones').load(__dirname);
!module.parent && require('bones').start();

